import axios from "axios";

const apiBaseUrl ="https://localhost:7085/api/";

export default {
    dCandidate(url = apiBaseUrl + 'dcandidate/'){
        return {
            fetchAll:() => axios.get(url), 
            fetchById: id => axios.get(url+id)
        }
    }
}
